import React, { Component } from 'react';

class Title extends Component {
    render() {
        const style = {
            color: 'black',
            fontWeight: 'bold',
            marginTop: '0px'
        };

        return <h1 style={style}>Liz's react app</h1>;
    }
}

export default Title;
